/**
 * @param {string} s
 * @return {string}
 */
var lastSubstring = function(s) {
	const arr = new Array(26).fill(0).map((item, index) => String.fromCharCode(122 - index));
	let index = 0;
	let lastLetter = arr[index];

	while(s.indexOf(lastLetter) === -1) {
		index++;
		lastLetter = arr[	index];
	}
	
	let result = '';
	
	for (let i=0; i<s.length; i++) {
		if (lastLetter === s[i]) {
			let temp = s.slice(i);
			if (temp > result) {
				result = temp;
			}
		}
	}

	return result;
};

console.time();
console.log('a::: ', lastSubstring(s));
console.timeEnd();
